import "./Staking.css";
import cover from "../../assets/staking-bg.png";

import becomepepbutton from "../../assets/becomepepbutton.png";
import Navigation from "../../components/Navigation/index";
import WalletBar from "../../components/WalletBar/index";

function Staking() {
  return (
    <div className="main-container">
      <Navigation />
      <div className="container-wrap">
        <div
          style={{
            backgroundPosition: "center",
            backgroundImage: `url(${cover})`,
            height: "100%",
            width: "100%",
            backgroundSize: "cover",
            backgroundRepeat: "no-repeat",
          }}
        >
          <WalletBar />
          <div className="main-container">
            <div className="text-container">
              <div style={{ marginTop: "30px" }}>
                <span className="Title">Staking</span>
              </div>
              <div className="Mask">
                <div className="Rectangle">
                  <span className="Stake-PPBLZ">Stake PPBLZ</span>
                  <span className="-APY">87% APY</span>
                </div>
                <span className="PPBLZ-balance">PPBLZ balance</span>
                HTML
                <span>46.600</span>
                <span className="PPBLZ-staked">PPBLZ staked</span>
                <span>0</span>
              </div>

              <div className="actiondiv"></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Staking;
